    args <- c(as.list(environment()), list(...))
    shape <- structure(list(userArn = structure(logical(0), tags = list(type = "string", 
        max = 95L, min = 32L, pattern = "^arn:aws:iam::\\d{12}:user(?:(\\u002F)|(\\u002F[\\u0021-\\u007E]+\\u002F))[\\w+=,.@-]+$")), 
        projectRole = structure(logical(0), tags = list(type = "string", 
            pattern = "^(Owner|Viewer|Contributor)$")), remoteAccessAllowed = structure(logical(0), 
            tags = list(box = TRUE, type = "boolean"))), tags = list(type = "structure"))
    return(populate(args, shape))
}

update_user_profile_input <- function (...) 
{
    args <- c(as.list(environment()), list(...))
    shape <- structure(list(userArn = structure(logical(0), tags = list(type = "string", 
        max = 95L, min = 32L, pattern = "^arn:aws:iam::\\d{12}:user(?:(\\u002F)|(\\u002F[\\u0021-\\u007E]+\\u002F))[\\w+=,.@-]+$")), 
        displayName = structure(logical(0), tags = list(type = "string", 
            max = 64L, min = 1L, pattern = "^\\S(.*\\S)?$", sensitive = TRUE)), 
        emailAddress = structure(logical(0), tags = list(type = "string", 
            max = 128L, min = 3L, pattern = "^[\\w-.+]+@[\\w-.+]+$", 
            sensitive = TRUE)), sshPublicKey = structure(logical(0), 
            tags = list(type = "string", max = 16384L, pattern = "^[\\t\\r\\n\\u0020-\\u00FF]*$"))), 
        tags = list(type = "structure"))
    return(populate(args, shape))
}

update_user_profile_output <- function (...) 
{
    args <- c(as.list(environment()), list(...))
    shape <- structure(list(userArn = structure(logical(0), tags = list(type = "string", 
        max = 95L, min = 32L, pattern = "^arn:aws:iam::\\d{12}:user(?:(\\u002F)|(\\u002F[\\u0021-\\u007E]+\\u002F))[\\w+=,.@-]+$")), 
        displayName = structure(logical(0), tags = list(type = "string", 
            max = 64L, min = 1L, pattern = "^\\S(.*\\S)?$", sensitive = TRUE)), 
        emailAddress = structure(logical(0), tags = list(type = "string", 
            max = 128L, min = 3L, pattern = "^[\\w-.+]+@[\\w-.+]+$", 
            sensitive = TRUE)), sshPublicKey = structure(logical(0), 
            tags = list(type = "string", max = 16384L, pattern = "^[\\t\\r\\n\\u0020-\\u00FF]*$")), 
